> Top News Murphy, Mets beat sleeping Dodgers 3-2 to reach NLCS vs Cubs Los Angeles Dodgers starting pitcher Zack Greinke, second from left, reacts alongside teammates in the dugout during the ninth inning in Game 5 of baseball's National League Division Series against the New York Mets on Thursday, Oct. 15, 2015, in Los Angeles. The Mets won 3-2 to advance to the NL Championship Series. (AP Photo/Lenny Ignelzi) From Our News Partners 
